import { Permiso } from "./permiso";
import { Empresa } from "./empresa";
export class Usuario {
  constructor(id = 0, nombre = '', token = '', permisos = new Array(), empresa = new Empresa()) {
    this.id = id;
    this.nombre = nombre;
    this.token = token;
    this.permisos = permisos;
    this.empresa = empresa;
  }

  inicializar(datos) {
    if (!!datos) {
      this.id = !!datos.id ? datos.id : 0;
      this.nombre = !!datos.nombre ? datos.nombre : '';
      this.token = !!datos.token ? datos.token : '';
      this.empresa = new Empresa();
      this.empresa.inicializar(datos.empresa);
      let permisos = !!datos.permisos ? datos.permisos : new Array();
      permisos.forEach(permiso => {
        let objPermiso = new Permiso();
        objPermiso.inicializar(permiso);
        this.permisos.push(objPermiso);
      });
    }
  }

}
